import React from 'react';
import './App.css';
import store from './store.js';



function MainContainer(props) {
    return(
        <div className='FolderList'>
            {store.folders.map(folder => (
                <Folder>
                    key={folder.id}
                    name={folder.name}
                </Folder>
            ))}
        </div>
    );
} 
export default MainContainer;
